};



export default Header;

//main container
const MainContainer =styled.header`
background-image: url(${myImage});
background-repeat: no-repeat;
background-size: cover;
background-position: center;
    height:30rem;


    h1{
        transform:translate(-50%,-50%);
        color:#;
        font-weight:900;
        position:absolute;
        top:25%;
